import { StyleSheet } from "react-native";

const StyleNotificationCenter = StyleSheet.create({
    articleContainer:{
        marginTop:"3%",
        marginLeft:"3.4%",
        marginBottom:"3%"
    },
    articleTextStyle:{
        fontSize:20
    }
})

export default StyleNotificationCenter
